// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

contract Checker is Ownable, ReentrancyGuard {
    struct User {
        address sponsor;
        uint256 id;
        bool exists;
    }

    IERC20 public token;
    address public firstId;
    uint256 public userIdCounter;
    uint256 private constant BONUS = 8; // Consider making this configurable

    mapping (address => User) public users;

    constructor(address _token) Ownable(msg.sender) {
        token = IERC20(_token);
        firstId = 0x87daB07Ec49e2eBdC126747FfA39488411b0d620; // Replace with actual address
        _saveUser(firstId, address(0));
    }

    function registerUser(address sponsor) public nonReentrant {
        // Check if user already exists
        require(!users[msg.sender].exists, "User is already registered");

        // Set default sponsor if none provided
        if (sponsor == address(0)) {
            sponsor = firstId;
        }

        // Check if sponsor exists
        require(users[sponsor].exists, "Sponsor does not exist");

        // Check user has sufficient allowance (assuming token has 18 decimals)
        require(token.allowance(msg.sender, address(this)) >= 30 ether, "Insufficient allowance");

        // Transfer registration fee and send bonus
        token.transferFrom(msg.sender, address(this), 30 ether);
        _sendBonus(sponsor, 10 ether);

        // Save user data
        _saveUser(msg.sender, sponsor);
    }

    function _saveUser(address user, address sponsor) private nonReentrant {
        users[user].id = ++userIdCounter;
        users[user].exists = true;
        if (sponsor != address(0)) {
            users[user].sponsor = sponsor;
        }
    }

    function _sendBonus(address recipient, uint256 amount) private {
        token.transfer(recipient, amount);
    }
}

